import React from 'react';
import picture from "./picture.png";
import './App.css';
import {
  RoundedCircle,
} from "bootstrap"

function App() {

    return (
    <div className="App">
        <img src={picture}   roundedCircle   alt="persopicture"   width="30" height="30" ></img>

    </div>
  );
}

export default App;
